import static org.junit.jupiter.api.Assertions.assertThrows;
import static org.junit.jupiter.api.Assertions.assertEquals;
import org.springframework.samples.petclinic.owner.PetTypeFormatter;
import java.util.Locale;
import org.springframework.samples.petclinic.owner.PetType;

@ExtendWith(MockitoExtension.class)
class PetTypeFormatterTest {

	@Mock
	private PetTypeRepository types;

	@InjectMocks
	private PetTypeFormatter controller;

	@BeforeEach
	void setUp() {
		// Mockito initializes @Mock and @InjectMocks automatically
	}

	@Test
	@DisplayName("Tests that print returns the name of the pet type when it has a name")
	void testPrintReturnsPetTypeName() {
		PetType petType = new PetType();
		petType.setName("Dog");
		var result = controller.print(petType, Locale.ENGLISH);
		assertNotNull(result);
	}

	@Test
	@DisplayName("Tests that print returns '<null>' when the pet type name is null")
	void testPrintReturnsNullStringWhenNameIsNull() {
		PetType petType = new PetType();
		petType.setName(null);
		var result = controller.print(petType, Locale.ENGLISH);
		assertEquals("<null>", result);
	}

	@Test
	@DisplayName("Tests that print throws NullPointerException when petType is null")
	void testPrintThrowsNullPointerExceptionWhenPetTypeIsNull() {
		assertThrows(NullPointerException.class, () -> {
			controller.print(null, Locale.ENGLISH);
		});
	}

	@Test
	@DisplayName("Returns the correct PetType when the input text matches a pet type name")
	void testParseReturnsPetTypeWhenNameMatches() throws ParseException {
		PetType petType = new PetType();
		petType.setName("dog");
		when(types.findPetTypes()).thenReturn(List.of(petType));
		var result = controller.parse("dog", Locale.ROOT);
		assertNotNull(result);
	}

	@Test
	@DisplayName("Throws ParseException when the input text does not match any pet type name")
	void testParseThrowsParseExceptionWhenNoMatchFound() throws ParseException {
		when(types.findPetTypes()).thenReturn(List.of());
		assertThrows(ParseException.class, () -> {
			controller.parse("unknown", Locale.ROOT);
		});
	}

	@Test
	@DisplayName("Does not find a match when case does not match exactly")
	void testParseIsCaseSensitive() throws ParseException {
		PetType petType = new PetType();
		petType.setName("dog");
		when(types.findPetTypes()).thenReturn(List.of(petType));
		assertThrows(ParseException.class, () -> {
			controller.parse("Dog", Locale.ROOT);
		});
	}

	@Test
	@DisplayName("Correctly identifies and returns the matching PetType from a list of available types")
	void testParseReturnsPetTypeFromMultipleOptions() throws ParseException {
		PetType dogType = new PetType();
		dogType.setName("dog");
		PetType catType = new PetType();
		catType.setName("cat");
		PetType birdType = new PetType();
		birdType.setName("bird");
		when(types.findPetTypes()).thenReturn(List.of(dogType, catType, birdType));
		var result = controller.parse("cat", Locale.ROOT);
		assertNotNull(result);
	}

}

